import React from 'react';
import { FaBars, FaBell, FaEnvelope } from 'react-icons/fa';

const Header = ({ toggleSidebar }) => {
  return (
    <header className="fixed top-0 left-0 right-0 h-[70px] bg-white shadow-md flex items-center px-6 z-20 ml-[260px] transition-all duration-300">
      <button 
        onClick={toggleSidebar} 
        className="bg-none border-none text-xl text-gray-dark cursor-pointer p-2 mr-4"
        aria-label="Toggle sidebar"
      >
        <FaBars />
      </button>

      <div className="ml-auto flex items-center gap-5">
        <div className="relative cursor-pointer">
          <FaBell className="text-xl text-gray" />
          <span className="absolute -top-2 -right-2 bg-danger text-white w-5 h-5 text-xs flex items-center justify-center rounded-full">3</span>
        </div>

        <div className="relative cursor-pointer">
          <FaEnvelope className="text-xl text-gray" />
          <span className="absolute -top-2 -right-2 bg-danger text-white w-5 h-5 text-xs flex items-center justify-center rounded-full">5</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
